text:
In 2008 our region was given an objective: significantly reduce our air pollution by 2024. Thanks to the leadership of the Sac Metro Air District and relentless collaboration across all levels of government we have met that goal!

Clean air saves lives. That’s why I will continue to use every tool at my disposal to ensure we remain at the forefront of the fight against climate change and harmful pollutants.

@AQMD

The @ACLgov provides crucial support for so many older Americans and people with disabilities in Sacramento, and nationwide. It keeps our most vulnerable fed through @_MealsOnWheels, it keeps them protected against abuse and neglect, and it allows seniors and people with disabilities the resources necessary to stay in their homes safely and with dignity.

@SecKennedy's choice to disband the ACL is not only callous and cruel, but also deadly and abandons people we are sworn to serve. This is why I am leading my colleagues to resist RFK Jr.'s misguided attempt to imperil those who require compassionate care. #OlderAmericansMonth

